INSERT INTO `block_custom` VALUES (1,'<p>Startup Growth Lite is the free version of <a href=\"http://www.morethanthemes.com/?q=themes/startupgrowth&mt-referral=scholarlylite\" target=\"_blank\">Startup Growth</a> by <a href=\"http://www.morethanthemes.com/&mt-referral=scholarlylite\" target=\"_blank\"> More than Themes</a>. </p>\r\n<p>Startup Growth  Lite is provided for everyone in the Drupal community to use and enjoy. You can use it for your personal or commercial projects, without any limitation. Although attribution is very much appreciated, it is not required. </p>\r\n<div class=\"more-link\"><a href=\"node/3\">Read more</a></div>','About','full_html'),(2,'<ul class=\"social-bookmarks text-right\">\r\n<li class=\"text\">\r\nFollow us on social media\r\n</li>\r\n<li class=\"facebook\">\r\n<a href=\"http://www.facebook.com/morethan.just.themes/\"><i class=\"fa fa-facebook\"></i></a>\r\n</li>\r\n<li class=\"twitter\">\r\n<a href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter\"></i></a>\r\n</li>\r\n<li class=\"googleplus\">\r\n<a href=\"https://plus.google.com/118354321025436191714/posts\"><i class=\"fa fa-google-plus\"></i></a>\r\n</li>                        \r\n<li class=\"linkedin\">\r\n<a href=\"http://www.linkedin.com/company/more-than-themes/\"><i class=\"fa fa-linkedin\"></i></a>\r\n</li>\r\n<li class=\"youtube\">\r\n<a href=\"http://www.youtube.com/morethanthemes/\"><i class=\"fa fa-youtube-play\"></i></a>\r\n</li>\r\n<li class=\"instagram\">\r\n<a href=\"http://instagram.com/\"><i class=\"fa fa-instagram\"></i></a>\r\n</li>\r\n<li class=\"flickr\">\r\n<a href=\"http://www.flickr.com/photos/morethanthemes/\"><i class=\"fa fa-flickr\"></i></a>\r\n</li>\r\n<li class=\"vimeo\">\r\n<a href=\"http://vimeo.com/morethanthemes\"><i class=\"fa fa-vimeo-square\"></i></a>\r\n</li>\r\n<li class=\"pinterest\">\r\n<a href=\"http://www.pinterest.com/morethanthemes/\"><i class=\"fa fa-pinterest\"></i></a>\r\n</li>\r\n<li class=\"skype\">\r\n<a href=\"#\"><i class=\"fa fa-skype\"></i></a>\r\n</li>\r\n</ul>','social-media','full_html'),(3,'<p>Startup Growth Lite comes with a wealth of regions and classes, providing, among others, a rich multi-level footer where you can place lots of information about your site.</p>\r\n<p>Therefore, the important pages of your site, can always be just one click away for your visitor, regardless where in your site they are navigating.</p>','rich-footer','full_html'),(4,'Interactively transition multidisciplinary niche markets before seamless best practices. Rapidiously recaptiualize synergistic supply chains without client-centric materials. Appropriately optimize transparent experiences and diverse ideas. ','right-sidebar-block','filtered_html'),(5,'<div style=\"text-align:center;\"><h2>Available features and pages</h2></div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h4>Full width page</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/4\">More »</a></p>\r\n</div> \r\n\r\n<div class=\"col-md-6\"> \r\n<h4>Page with two sidebars</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/5\">More »</a></p>\r\n</div> \r\n</div>','front-page-presentation','full_html'),(6,'<div style=\"text-align:center;\"><h2>Available features and pages</h2></div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h4>Page with right sidebar</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/6\">More »</a></p>\r\n</div> \r\n\r\n<div class=\"col-md-6\"> \r\n<h4>Page with left sidebar</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/9\">More »</a></p>\r\n</div> \r\n</div>','front-page-presentation-2','full_html'),(7,'<div style=\"text-align:center;\"><h2>Yet more available pages</h2></div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h4>Responsive grid</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/7\">More »</a></p>\r\n</div> \r\n\r\n<div class=\"col-md-6\"> \r\n<h4>Typography</h4>\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n<p><a href=\"node/1\">More »</a></p>\r\n</div> \r\n</div>','front-page-presentation-3','full_html'),(8,'<p>Phosfluorescently utilize future-proof scenarios whereas timely leadership skills. Seamlessly administrate maintainable quality vectors whereas proactive mindshare.</p>\r\n<p>Dramatically plagiarize visionary internal or \"organic\" sources via process-centric. Compellingly exploit worldwide communities for high standards in growth strategies.</p>\r\n<p><a href=\"#\" class=\"more\">Get free trial</a></p>','parallax-left','full_html'),(9,'<blockquote>Wow, this most certainly is a great a theme. </blockquote>\r\n<div style=\"padding:0 0 0 150px;\">\r\n<strong>John Smith</strong>\r\nCompany name\r\n</div>','parallax-right','full_html'),(10,'Objectively conceptualize high standards in intellectual capital vis-a-vis covalent meta-services. Dramatically synthesize just in time core competencies through interactive intellectual capital. Compellingly impact focused mindshare after fully researched testing procedures. 